import React, { Component } from 'react';

class Nav extends Component{
    render() {
      console.log('Subject render');
      return (
        <header>
            <h1><a href="/" onClick={function(e){
              e.preventDefault();
              this.props.onChangePage();
            }.bind(this)}><img class="Ask-for-Question"></img></a></h1>
            <nav>
                <ul>
                    <li><a href="1.html">나의 테스트</a></li>
                    <li><a href="2.html">나의 그룹</a></li>
                    <li><a href="3.html">찾아보기</a></li>
                </ul>
            </nav>
        </header>
      );
    }
  }

export default Nav;
